import Login from "../views/login/index.js";
import Register from "../views/register/index.js";
import NotFound from "../views/notFound/index.js";

var routes = [

		{
			component : Login,
			path: "/login",

		},
		{
			component: Register,
			path: "/register",
		},
		{
			component: notFound,
			path: "*"
		}

]

export default routes;
